import logo from './logo.svg';
import './App.css';

import React from 'react';

// Navigation component
const Navigation = () => {
  return (
    <nav>
      <ul>
        <li><a href="#news">News</a></li>
        <li><a href="#about">About</a></li>
        <li><a href="#music">Music</a></li>
        <li><a href="#links">Links</a></li>
      </ul>
    </nav>
  );
};

// Main section components


const Links = () => {
  return (
    <section id="links">
      {/* Links content */}
    </section>
  );
};

const Music = () => {
  return (
    <section id="music">
      {/* Music content */}
    </section>
  );
};

const About = () => {
  return (
    <section id="about">
      {/* About content */}
      <p> Marek is a singer-songwriter based in Berlin, Germany. </p> 
    </section>
  );
};

const News = () => {
  return (
    <section id="news">
      {/* News content */}
    </section>
  );
};

// Footer component
const Footer = () => {
  return (
    <footer>
      <section>
        {/* Impressum content */}
      </section>
      <p>&copy; {new Date().getFullYear()} Your Artist Name. All rights reserved.</p>
    </footer>
  );
};

// Main component representing the entire page
const ArtistPage = () => {
  return (
    <div>
      <Navigation />
      <main>
        <News />
        <Links />
        <Music />
        <About />
      </main>
      <Footer />
    </div>
  );
};

export default ArtistPage;
